import React from 'react';

function PasswordRepeat (props) {
  let warning
  if (props.checkedPassword===1) {warning=<div>Введите пароль</div>}
  if (props.checkedPassword===2) {warning=<div>Укажите пароль</div>}
  return (
    <div className="CityPasMail">
      <div className="headingLayout">Пароль еще раз</div>
      <div className="menuLayout">
        <input className="inputText" type="text" value={props.valuePasswordRepeat} onChange={props.changeValuePasswordRepeat}>
        </input>
      </div>
      <div className="inscription">
        Повторите пароль, чтобы обезопасить вас с нами на случай ошибки
      </div>
      <div className="outputWarning">
      </div>
    </div>
  )
}

export default PasswordRepeat
